import React from "react";
// import "./Navbar.css";

export default function Navbar() {
  return (
    <>
      <div className="shadow-md w-full fixed top-0 left-0">
          <div className="md:flex bg-white py-4">
              <div className="">
                  <ul className="font-bold flex items-center text-1xl	font-[Poppins]  cursor-pointer">
                    <li><a href="#" className="text-gray-950 no-underline ">Home</a></li>
                    <li><a href="#" className="text-gray-950 no-underline ">Shop+</a></li>
                    <li><a href="#" className="text-gray-950 no-underline ">Pages +</a></li>
                    <li><a href="#" className="text-gray-950 no-underline ">Blog +</a></li>
                    <li><a href="#" className="text-gray-950 no-underline text-">Contact</a></li>
                  </ul>
               
              </div>
          </div>
      </div>
    </>
  );
}
